import React from 'react';
import { Line } from "react-chartjs-2";
import "./CycleTime.css"
import * as FaIcons from 'react-icons/fa'



import {
  LineChart_CycleTime, 
} from "variables/charts";


const CycleTime = ({LineChart_CycleTime_Example1}) => {


        return (
    <>

            <div className='CycleTime'>

                <div className='CycleTime-header'>
                  <FaIcons.FaChartArea className='CycleTime-icon' size={20} color={'white'}/>
                  <h3 className='CycleTime-title'>Cycle Time </h3>
                </div>

              <div className="CycleTime-body">
                  <div className="CycleTime-chart">
                    <Line
                      data={LineChart_CycleTime[LineChart_CycleTime_Example1]}
                      options={LineChart_CycleTime.options}
                    />
                  </div>

              </div>
            </div>

     </>
        )

};

export default CycleTime;
